import React from 'react';
import '../../../App.css';
import '../../HeroSection.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import Dropdown from 'react-bootstrap/Dropdown';
// import { Link } from 'react-router-dom';

function ParSearch() {
    return (
        <div>
            <div className='hero-container'>
                <h1 className="register-title">Search for Studies</h1>
                <form action="/participant-search" method="POST">
                    <div class="form-container">
                        {/* <div class="form-group"> */}
                            <center>
                            <div class="small-buff"></div>
                            <Dropdown>
                                <Dropdown.Toggle variant="success" id="dropdown-basic">
                                    Age
                                </Dropdown.Toggle>

                                <Dropdown.Menu>
                                    <Dropdown.Item href="#/action-1">Under 18</Dropdown.Item>
                                    <Dropdown.Item href="#/action-2">18+</Dropdown.Item>
                                    <Dropdown.Item href="#/action-3">All Ages</Dropdown.Item>
                                </Dropdown.Menu>
                            </Dropdown>
                            <input class="input-box" name="search" type="text" id="search"></input>
                            <input type="submit" value="search" id="sendToServerButton"></input>
                            </center>
                        </div>
                    {/* </div> */}


                </form>
            </div>

        </div>
    )
}

export default ParSearch
